import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { BrowserRouter as Router } from 'react-router-dom';
import ScrollTop from './Components/ScrollTop';
ReactDOM.render(
    <Router>
        <ScrollTop>
        <App />
        </ScrollTop>
    </Router>
, document.getElementById('root'));
